  from discrete sample and profile observations using CTD, bottle and other instruments
  from the YMER in the Arctic Ocean, Barents Sea and North Greenland Sea from 1980-08-11
  to 1980-09-19 (NODC Accession 0113607)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
