  [],\n\t\"revision_timestamp\": \"2015-09-27T01:15:28.205771\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation58246\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113607 includes chemical,
  discrete sample, physical and profile data collected from YMER in the Arctic Ocean,
  Barents Sea and North Greenland Sea from 1980-08-11 to 1980-09-19 and retrieved
  during cruise CARINA/77YM19800811. These data include DISSOLVED OXYGEN, Delta Oxygen
  - 18, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE, TRITIUM and WATER TEMPERATURE. The instruments used to collect these data
  include CTD and bottle. These data were collected by Leif Anderson of Gothenburg
  University; Department of Analytical and Marine Chemistry as part of the CARINA/77YM19800811
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
